CREATE TABLE IF NOT EXISTS "apploan_quotemotor" ("id" SERIAL PRIMARY KEY, "brand" varchar(100) NOT NULL, "model" varchar(255) NOT NULL, "year_reg" varchar(20) NOT NULL, "name" varchar(255) NOT NULL, "gender" varchar(10) NOT NULL, "status" varchar(10) NOT NULL, "number" varchar(20) NOT NULL, "dob" date NOT NULL, "occupation" varchar(100) NOT NULL, "ride_exp" varchar(50) NOT NULL, "ncd_disc" varchar(10) NOT NULL, "licence" varchar(50) NOT NULL, "named_rider" varchar(10) NOT NULL, "claims" varchar(10) NOT NULL, "start_date" date NOT NULL, "end_date" date NOT NULL, "remarks" text NOT NULL, "privacy_policy" BOOLEAN NOT NULL, "created_at" TIMESTAMP NOT NULL);
