CREATE TABLE IF NOT EXISTS "apploan_applycoe" ("id" SERIAL PRIMARY KEY, "vehicle_type" varchar(10) NOT NULL, "full_name" varchar(255) NOT NULL, "contact_number" varchar(20) NOT NULL, "email" varchar(254) NOT NULL, "consent" BOOLEAN NOT NULL, "created_at" TIMESTAMP NOT NULL);
